  output [31:0] tx_fifo_out;
  input clk, n_rst, tx_enq, tx_deq_word;
  output full, empty;
  wire   count_en1, count_en2, tail_tog, head_tog;
  wire   [1:0] head_side;
  wire   [2:0] tail_ptr;
  wire   [2:0] head_ptr;

  tx_fifo_fsm FSM ( .clk(clk), .n_rst(n_rst), .tx_deq_word(tx_deq_word), 
        .empty(empty), .head_side(head_side), .count_en1(count_en1), 
        .count_en2(count_en2) );
  tx_counter_tail TAIL_PTR ( .clk(clk), .n_rst(n_rst), .tx_enq(tx_enq), 
        .tail_ptr(tail_ptr), .tail_tog(tail_tog) );
  tx_counter_head HEAD_PTR ( .clk(clk), .n_rst(n_rst), .count_en2(count_en2), 
        .head_ptr(head_ptr), .head_tog(head_tog) );
